INSERT INTO `tbl_countries` VALUES ('1', 'Kenya', 'Situated on the equator on Africa&#039;s east coast, Kenya has been described as &quot;the cradle of humanity&quot;.\r\nIn the Great Rift Valley palaeontologists have discovered some of the earliest evidence of man&#039;s ancestors.\r\n\r\nIn the present day, Kenya&#039;s ethnic diversity has produced a vibrant culture but is also a source of conflict.', 'countries/kenya_icon_2.jpg', 'countries/kenya_banner.jpg', '1', 'Tim Forster', '2019-09-30 16:24:59', 'Tim Forster', '2019-10-04 16:19:10');
INSERT INTO `tbl_countries` VALUES ('2', 'Tanzania ', 'Tanzania has been spared the internal strife that has blighted many African states.\r\n\r\nDomestic stability has not translated into economic prosperity for Tanzanians, however. Many of its people live below the World Bank poverty line, although the country has had some success in wooing donors and investors.\r\n\r\nTanzania is home to two renowned tourism destinations - Africa&#039;s highest mountain, Kilimanjaro, and wildlife-rich national parks such as the Serengeti - but has become a target for poachers. ', 'countries/tanzania_icon_1.jpg', 'countries/Tanzania_Banner.jpg', '1', 'Tim Forster', '2019-09-30 17:59:20', 'Tim Forster', '2019-10-01 09:10:03');
INSERT INTO `tbl_countries` VALUES ('4', 'Botswana', 'Botswana, one of Africa&#039;s most stable countries, is the continent&#039;s longest continuous multi-party democracy. It is relatively free of corruption and has a good human rights record.\r\n\r\nSparsely populated, Botswana protects some of Africa&#039;s largest areas of wilderness. Safari-based tourism - tightly-controlled and often upmarket - is an important source of income.\r\n\r\nBotswana is the world&#039;s largest producer of diamonds and the trade has transformed it into a middle-income nation.', 'countries/botswana_icon.jpg', 'countries/Botswana_banner_1.jpg', '1', 'Tim Forster', '2019-09-30 17:56:14', 'Tim Forster', '2019-10-01 09:12:18');
INSERT INTO `tbl_countries` VALUES ('5', 'Mozambique', 'Mozambique, which gained independence from Portugal in 1975, is still suffering from the effects of a 16-year civil war that ended in 1992.\r\n\r\nTensions remain between the ruling Frelimo party and the opposition former rebel movement Renamo and corruption has become a major concern.\r\n\r\nThe discovery of gas fields off Mozambique&#039;s coast in 2011 is set to transform the economy of one of Africa&#039;s poorest nations.', 'countries/Mozambique_icon.jpg', 'countries/Mozambique_Banner.jpg', '1', 'Tim Forster', '2019-09-30 19:58:10', 'Tim Forster', '2019-10-01 09:12:31');
