INSERT INTO `tbl_hits` VALUES ('762', '109.157.245.44', '2019-10-01 09:10:03', '/silverless-works.com/c_p/editcountry.php', 'country_name=Tanzania    country_desc=Tanzania has been spared the internal strife that has blighted many African states.\r\n\r\nDomestic stability has not translated into economic prosperity for Tanzanians, however. Many of its people live below the World Bank poverty line, although the country has had some success in wooing donors and investors.\r\n\r\nTanzania is home to two renowned tourism destinations - Africa&#039;s highest mountain, Kilimanjaro, and wildlife-rich national parks such as the Serengeti - but has become a target for poachers.    country_icon=countries/tanzania_icon_1.jpg   country_banner=countries/Tanzania_Banner.jpg   country_id=2   ', 'http://176.32.230.252/silverless-works.com/c_p/edit_country.php?id=2', '1');
