INSERT INTO `tbl_hits` VALUES ('861', '109.157.245.44', '2019-10-01 11:13:37', '/silverless-works.com/c_p/editregion.php', 'region_name=Meru   region_desc=Mount Meru is an active (but dormant) volcano located north of Arusha in Tanzania.\r\nAt 4562 metres it is Tanzania&#039;s second highest mountain and the fourth highest mountain in Africa.\r\n\r\nThe mountain became well known mainly because it is only 70 km from Mount Kilimanjaro:\r\nMt. Meru has become a popular &quot;warm up&quot; trek for Kilimanjaro climbers.   region_id=3   country_id=2   region_icon=   region_banner=regions/meru_banner.jpg   ', 'http://176.32.230.252/silverless-works.com/c_p/edit_region.php?id=3', '1');
