INSERT INTO `tbl_hits` VALUES ('872', '109.157.245.44', '2019-10-01 11:35:23', '/silverless-works.com/c_p/editregion.php', 'region_name=Chobe   region_desc=120,000 elephants roam Chobe &ndash; more than anywhere else on the planet and seeing these vast herds is an unforgettable experience and the reason Chobe is called &#039;Land of Giants&#039;.There&#039;s plenty to see with the changing seasons but it is during the dry season in particular that Chobe impresses, with herds congregating at the Chobe and Linyanti Rivers.\r\n\r\nThe Chobe riverfront is the most accessible safari area, reached easily by road from Kasane. Safari boats ply the river while huge herds of elephant, buffalo, lechwe and puku gather on the banks.\r\n\r\nIf you want to be in the thick of it - head for the river. The forest reserve is a quieter region of Chobe, with far less traffic and stunning views over the river below.    region_id=4   country_id=4   region_icon=   region_banner=regions/chobe_banner.jpg   ', 'http://176.32.230.252/silverless-works.com/c_p/edit_region.php?id=4', '1');
