INSERT INTO `tbl_hits` VALUES ('929', '109.157.245.44', '2019-10-01 12:59:07', '/silverless-works.com/c_p/editregion.php', 'region_name=Nairobi   region_desc=Kenya&rsquo;s capital city has risen in a single century from a brackish uninhabited swampland to a thriving modern capital. Modern Nairobi is still the safari capital of the Africa, but the modern world has quickly caught up with the city. A frontier town no more, Nairobi has become one of Africa&rsquo;s largest, and most interesting cities.\r\nNairobi is a city that never seems to sleep. The entire town has a boundless energy, and is thriving place where all of human life can be found.\r\n\r\nThis is a place of great contrasts where race, tribe and origin all become facets of a unique Nairobi character.The city has not lost its sense of the past, with an excellent museum and the historical home of Karen Blixen, author of Out of Africa open to visitors.\r\n\r\nThis is not a modern capital separated from the great wilderness that surrounds it. Just outside the city is Nairobi National Park, 113 sq kms of plains, cliffs and forest. The park is home to large herds of Zebra, Wildebeest, Buffalo, Giraffe and more. Rhino, Cheetah, and a large number of Lions are all found here, living wild within 20 minutes of the centre of town.   region_id=2   country_id=1   region_icon=regions/Nairobi_icon_1.jpg   region_banner=regions/Nairobi_banner_1.jpg   season_title1=Springish   month_from1=2   month_to1=5   max_temp1=32   min_temp1=14   season_title2=Summer   month_from2=6   month_to2=8   max_temp2=38   min_temp2=15   season_title12=Autumn   month_from12=9   month_to12=11   max_temp12=36   min_temp12=14   seaonsIDs=1|2|12|   ', 'http://176.32.230.252/silverless-works.com/c_p/edit_region.php?id=2', '1');
