INSERT INTO `tbl_hits` VALUES ('1234', '109.157.245.44', '2019-10-02 13:59:37', '/silverless-works.com/c_p/editregion.php', 'region_name=Manica   region_desc=Manica is a Province in Mozambique, and featured here is Chimoio which is the capital of the province.\r\nThere are quite a few different accommodation options available in this province, ranging from Hotels, to lodges to self-catering houses.  Please view the accommodation directory for more information.\r\n\r\nMozambique has a subtropical climate, with a dry season lasting from April to December, and a rainy season from January to March. The beaches on both the Bazaruto and Quirimbas archipelagos are stunning throughout the dry season, although the winter (June - August) months can be breezy; especially in the north. The optimal time to visit is September to November, when the game viewing is at its best, the weather calmest and warmest, and whale migration can also be observed.   region_id=5   bl_live=2   country_id=5   region_icon=   region_banner=regions/manica.jpg   season_title15=Summer   month_from15=6   month_to15=9   max_temp15=30   min_temp15=30   seasonIDs=15|   ', 'http://176.32.230.252/silverless-works.com/c_p/edit_region.php?id=5', '1');
