INSERT INTO `tbl_regions` VALUES ('1', '1', 'Samburu', 'Samburu National Reserve is situated at the southeastern corner of Samburu District in the Rift Valley Province of Kenya. It is bordered to the south by Ewaso Nyiro River, which separates it from the Buffalo Springs National Reserve.\r\n\r\nThe reserve covers an area of 165 Km&sup2; and is located around 345Km from Nairobi.', 'regions/samburu_icon.jpg', 'regions/samburu_banner.jpg', '1', 'Tim Forster', '2019-09-27 00:00:00', 'Tim Forster', '2019-10-01 11:10:36');
INSERT INTO `tbl_regions` VALUES ('2', '1', 'Nairobi', 'Kenya&rsquo;s capital city has risen in a single century from a brackish uninhabited swampland to a thriving modern capital. Modern Nairobi is still the safari capital of the Africa, but the modern world has quickly caught up with the city. A frontier town no more, Nairobi has become one of Africa&rsquo;s largest, and most interesting cities.\r\nNairobi is a city that never seems to sleep. The entire town has a boundless energy, and is thriving place where all of human life can be found.\r\n\r\nThis is a place of great contrasts where race, tribe and origin all become facets of a unique Nairobi character.The city has not lost its sense of the past, with an excellent museum and the historical home of Karen Blixen, author of Out of Africa open to visitors.\r\n\r\nThis is not a modern capital separated from the great wilderness that surrounds it. Just outside the city is Nairobi National Park, 113 sq kms of plains, cliffs and forest. The park is home to large herds of Zebra, Wildebeest, Buffalo, Giraffe and more. Rhino, Cheetah, and a large number of Lions are all found here, living wild within 20 minutes of the centre of town.', 'regions/Nairobi_icon_1.jpg', 'regions/Nairobi_banner_1.jpg', '1', 'Tim Forster', '2019-09-27 00:00:00', 'Tim Forster', '2019-10-01 13:53:47');
INSERT INTO `tbl_regions` VALUES ('3', '2', 'Meru', 'Mount Meru is an active (but dormant) volcano located north of Arusha in Tanzania.\r\nAt 4562 metres it is Tanzania&#039;s second highest mountain and the fourth highest mountain in Africa.\r\n\r\nThe mountain became well known mainly because it is only 70 km from Mount Kilimanjaro:\r\nMt. Meru has become a popular &quot;warm up&quot; trek for Kilimanjaro climbers.', '', 'regions/meru_banner.jpg', '1', 'Tim Forster', '2019-09-27 00:00:00', 'Tim Forster', '2019-10-01 13:54:41');
INSERT INTO `tbl_regions` VALUES ('4', '4', 'Chobe', '120,000 elephants roam Chobe &ndash; more than anywhere else on the planet and seeing these vast herds is an unforgettable experience and the reason Chobe is called &#039;Land of Giants&#039;.There&#039;s plenty to see with the changing seasons but it is during the dry season in particular that Chobe impresses, with herds congregating at the Chobe and Linyanti Rivers.\r\n\r\nThe Chobe riverfront is the most accessible safari area, reached easily by road from Kasane. Safari boats ply the river while huge herds of elephant, buffalo, lechwe and puku gather on the banks.\r\n\r\nIf you want to be in the thick of it - head for the river. The forest reserve is a quieter region of Chobe, with far less traffic and stunning views over the river below. ', '', 'regions/chobe_banner.jpg', '1', 'Tim Forster', '2019-10-01 11:29:39', 'Tim Forster', '2019-10-01 11:35:23');
INSERT INTO `tbl_regions` VALUES ('5', '5', 'Manica', 'Manica is a Province in Mozambique, and featured here is Chimoio which is the capital of the province.\r\nThere are quite a few different accommodation options available in this province, ranging from Hotels, to lodges to self-catering houses.  Please view the accommodation directory for more information.\r\n\r\nMozambique has a subtropical climate, with a dry season lasting from April to December, and a rainy season from January to March. The beaches on both the Bazaruto and Quirimbas archipelagos are stunning throughout the dry season, although the winter (June - August) months can be breezy; especially in the north. The optimal time to visit is September to November, when the game viewing is at its best, the weather calmest and warmest, and whale migration can also be observed.', '', 'regions/manica.jpg', '1', 'Tim Forster', '2019-10-02 13:53:59', 'Tim Forster', '2019-10-02 13:59:53');
